import React, { Component } from 'react';
import './todo.css';

class Todo extends Component {
  render() {
    return (
      <div className="Todo">
        <form>
          <label>
            Title
            <input 
              type="text"
            />
          </label>
          <label>
            Task
            <input 
              type="text"
            />
          </label>
          <label>
            Color
            <input 
              type="color"   
            />
          </label>
          <button type="submit">Submit</button>
        </form>
      </div>
    );
  }
}

export default Todo;
